import { ScreenHelmet, useNavigator } from '@karrotframe/navigator';
import React from 'react';

const Home = () => {
  const { push } = useNavigator();
  const handleGameStart = () => {
    push(`/game`);
  };
  return (
    <div>
      <ScreenHelmet title="홈" />
      <span>서울 광진구</span>
      <h1>민수님은 573위 에요!</h1>
      <button onClick={handleGameStart}>시작하기</button>
    </div>
  );
};

export default Home;
